import Link from 'next/link';
import Header from '../components/Header';
import Layout from '../components/Layout';

export default function About() {
  return (
    <Layout>
      <Header />
      <Link href='/index'>
        <a title='Homepage'>Home Page</a>
      </Link>
    </Layout>
  );
}
